import React from 'react';
import './Form.css';


const Form  = ({onEmailChange, onPasswordChange, onSumbitSignIn}) => {
  return (

    <div className="flex flex-wrap justify-center items-center center f1-ns tc  bg-form  " >

     <div className="measure center ma4">
       <form className="bg-form-content pa4 br2">
           <fieldset id="sign_up" className="ba b--transparent ph0 mh0 mw6 center">
             <h1 className="f1-l lh-solid f2 ttu fw3  tl">Cuentanos</h1>
             <p className="f3 tl ">Tus ideas, la podemos desarrollar y plasmar en algo concreto y funcional. Descarga nuestra guia que te ayudara a distinguir los puntos que te faltan desarrollar.</p>

             <div className="mt3 formlh">
               <input
                 //onChange = {}
                 className="tc br2 input-reset ba b-- bg-transparent hover-bg-black hover- w-100 h2 f4"
                 type="text"
                 name="name"
                 id="name"
                 placeholder="Nombre y Apellido"
                 //value= {}
                 />
             </div>
             <div className="mt3 formlh">
               <input
                 //onChange = {}
                 className="tc br2 input-reset ba b-- bg-transparent hover-bg-black hover- w-100 h2 f4"
                 type="text"
                 name="empresa"
                 id="empresa"
                 placeholder="Empresa"
                 //value= {}
                 />
             </div>
             <div className="mt3 formlh ">
               <input
                 //onChange = {}
                 className="tc br2 input-reset ba b-- bg-transparent hover-bg-black hover- w-100 h2 f4"
                 type="text"
                 name="rubro"
                 id="rubro"
                 placeholder="Rubro"
                 //value= {}
                 />
             </div>
             <div className="mt3 formlh ">
               <input
                 //onChange = {}
                 className="tc br2 input-reset ba b-- bg-transparent hover-bg-black hover- w-100 h2 f4"
                 type="tel"
                 name="phone-num"
                 id="phone-num"
                 placeholder="(+51) Número"
                 //value= {}
                 />
             </div>
             <div className="mt3 formlh">
               <input
                 onChange = {onEmailChange}
                 className="tc br2 input-reset ba b-- bg-transparent hover-bg-black hover- w-100 h2 f4"
                 type="email"
                 name="email-address"
                 id="email-address"
                 placeholder="email@mail.com"
                 required
                 value= {onEmailChange.signInEmail}
                 />
             </div>

             <div className="mv3 formlh">
               <textarea
                  //onChange = {}
                 className="br2  input-reset ba b-- bg-transparent hover-bg-black hover- w-100 f4"
                 name="message"
                 rows="3"
                 cols="10"
                 //value= {}
               />
            </div>

           </fieldset>
             <div className="">
               <input
                 onClick = {onSumbitSignIn}
                 className=" f3 ph4 tracked-tight dib bg-animate hover-bg-purple hover- no-underline pv3 ph5-l br2 ba boton-bg border-col "
                 type="submit"
                 value="DESCARGAR GUIA"/>
             </div>
       </form>
     </div>

  </div>




  );


}

export default Form;
